    /**
     * 暴力法：计算时间太久，而且内存占用量大
     * @param s
     * @return
     */

    public static int lengthOfLongestSubstring(String s) {
        if (s == null || s.isEmpty())
            return 0;

        int len = 0;
        char[] chars = s.toCharArray();
        Map<Integer, String> substringSequence = new HashMap<>();

        // 获取所有子串
        for (int start = 0; start < chars.length; start++) {
            StringBuffer buffer = new StringBuffer(chars[start]);
            for (int end = start; end < chars.length; end++) {
                buffer.append(chars[end]);
//                System.out.println(buffer);
                if (!hasRepeated(String.valueOf(buffer))) {
                    substringSequence.put(end - start + 1, String.valueOf(buffer));
                }
            }
        }

        len = chars.length;
        while(len > 0) {
            if (substringSequence.containsKey(len)) {
                System.out.println(len);
                return len;
            }
            len--;
        }

        return len;
    }

    // judge if the substring has repeated chars
    public static boolean hasRepeated(String substring) {
        List<Character> lists = new ArrayList<>();
        char[] subchars = substring.toCharArray();
        for (int k = 0; k < subchars.length; k++) {
            if (lists.contains(subchars[k])) {
                return true;
            }
            lists.add(subchars[k]);
        }
        return false;
    }


    /**
     * @details 滑动窗口
     * 通过使用 HashSet 作为滑动窗口，我们可以用 O(1)O(1) 的时间来完成对字符是否在当前的子字符串中的检查。
     * 滑动窗口是数组/字符串问题中常用的抽象概念。 窗口通常是在数组/字符串中由开始和结束索引定义的一系列元素的集合，即 [i, j)[i,j)（左闭，右开）。
     * 而滑动窗口是可以将两个边界向某一方向“滑动”的窗口。例如，我们将 [i, j)[i,j) 向右滑动 1 个元素，则它将变为 [i+1, j+1)[i+1,j+1)（左闭，右开）。
     */
    public static int slideWindow(String s) {
        int len = 0, start = 0, end = 0;
        Set<Character> characterSet = new HashSet<>();
        if (s.equals("") || s.equals(null)) {
            return 0;
        }

        while(start < s.length() && end < s.length()) {
            // 若set中没有重复元素，则增加该元素，并且end++，窗口右边界向右滑动
            if (!characterSet.contains(s.charAt(end))) {
                characterSet.add(s.charAt(end));
                end++;
                len = Math.max(len, end - start);
            }
            // 若set中有重复元素，则移除start元素，然后start++，窗口左边界向右滑动
            else {
                characterSet.remove(s.charAt(start));
                start++;
            }
        }

        return len;
    }
